import styled from 'styled-components';

const QuestionItemNumButton = styled.div`
    margin-right: 20px;
    width: 30px;
    height: 30px;
    border-radius: 30px;
    border: 5px solid blue;
`;

const QuestionItemNumButtonText = styled.div`
  font-size: 17px;
`;

export default function QuestionItemNum(props) {
    return (
      <>
        <QuestionItemNumButton>
          <QuestionItemNumButtonCircle/>
        </QuestionItemNumButton>
      </>
    );
}
